('node', 'page', 0, 1, 1, 'und', 0, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', '', 'full_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\r\n', '', 'filtered_html'),
('node', 'blog_content', 0, 4, 4, 'und', 0, 'With the planned date for PHP 7’s release rapidly approaching, the internals group is hard at work trying to fix our beloved language as much as possible by both removing artifacts and adding some long desired features. There are many RFCs we could study and discuss, but in this post, I’d like to focus on three that grabbed my attention.\r\nPHP 5.7 vs PHP 7\r\n\r\nAs I mentioned in the last newsletter, 5.7 has been downvoted in favor of moving directly to PHP 7. This means there will be no new version between 5.6 and 7 – even if the new version was only to serve as a warning light to those still stuck on outdated code. Originally, 5.7 was not supposed to have new features, but was supposed to throw out notices and warnings of deprecation about code that’s about to change in v7. \r\n\r\nIt would also warn about some keywords that are to be reserved in PHP 7, so that people can bring their code up to speed with a sort of “automatic” compatibility checker in the form of an entire PHP version. The thing is, however, as I argue in the newsletter, that most people technologically competent enough to follow PHP in its upgrade path by keeping up with the most recent version aren’t generally the type of people to actually be using code that might break in PHP 7.\r\n\r\nWhile this is a good discussion to have, what’s done is done and the voting is over. What do you think about this?', '', 'full_html'),
('node', 'blog_content', 0, 5, 5, 'und', 0, 'Chances are you’ve come across some horrible legacy code once or twice in your lifetime as a PHP developer. Heck, if you’ve worked with WordPress to any degree, I’m sure you have. I myself have had the satisfying task of modernizing a monolithic ZF1 application, and it was the most mentally exhaustive (but, admittedly, the most educational) year of my career.\r\n\r\nIf only I had had Paul M. Jones’ “Modernizing Legacy Applications In PHP” book back then, I would have been done in half the time, and the work I did would have been twice as good.\r\nThe Book\r\n\r\nMany thanks to Paul for providing me with a review copy after having read my review of Design Patterns in PHP. The book is a Leanpub publication – meaning it’s self-published – but that’s where similarities with other Leanpub content I’ve consumed so far end.\r\n\r\nModernizing Legacy Applications in PHP is a detailed step by step guide in turning a spaghetti mess of old PHP code you’ve probably inherited from a team that left two generations ago, into a sort of fully fledged MVC application with the front controller, router, dependency injection, and even unit tests. \r\n\r\nRather than regurgitating common examples found online and various Wikipedia definitions in shortened form, the book takes a hands on approach with sample code eerily similar to things I’ve seen over and over again in legacy projects. This not only verifies a senior developer’s suspicions about the similar state of decrepitude in most legacy apps, but also inspires one to delve deeper as it seems most of us share the same problems at some time and, thus, can use the same solutions.\r\nApproachability\r\n\r\nThis book is not for beginners. I mean, if you’re a beginner, I recommend getting it right away and just keeping it in your Leanpub dashboard for when you’ll be able to implicitly recognize the terms discussed within; but if you don’t have a horrible large-scale legacy project or two under your belt before you start reading it, you won’t understand much and ploughing through the content on auto-pilot without knowing what it does is counterproductive at best. Besides, you’ll probably do it wrong because every legacy app is different, despite most of them being similar.\r\n\r\nThis book is aimed at intermediate and higher level PHP users, with an emphasis on seniors. Intermediate devs won’t get 100% out of it. They’ll understand more of the content, and they’ll be able to use some of it as a prevention against future horrors while working on their apps right now (which, again, is reason enough to recommend a purchase), but intermediate devs are generally still getting familiar with best practices and haven’t been out of the procedural marshes for very long, the mud and sludge still dripping from their “I finally know PHP” shirts.', '', 'full_html'),
('node', 'blog_content', 0, 6, 6, 'und', 0, 'API stands for ‘Application Programming Interface’ and as the name implies, creating one is a technical process. This article will talk very little about how to create an API as there are a myriad of methods to undertake that. This article aims to focus on the business side of APIs and supply advice for non-technical folk.\r\n\r\nAn API is a set of functionality and instructions to allow other software access to services or information you offer. An API is typically (should be) written following standard patterns and can be free or monetized in several ways.\r\nWho Has Them?\r\n\r\nLets start with some examples to better illustrate what an API is and how they are used.\r\nMost online services of any worth\r\n\r\nThese examples are obvious ones, but worth starting with to clarify the concept. APIs are part of the core business of companies such as Google, SalesForce, Yelp and Twitter. All of these companies provide access to the information they posses through APIs that are widely used by other businesses and their developers in a variety of applications. All of these companies offer varying payment levels depending on the quality or quantity of access you require, from free upwards.\r\nGovernment, civic and science organizations\r\n\r\nThese are not conventional businesses but this sector has seen such a recent growth in API adoption it seemed worthy of mention. Governments across the world, from local to federal have started releasing certain data sets to the public through APIs. There is mixed opinion on how effective and useful some of these data sets have been, but it is a brave first step and some have resulted in incredible insights and applications.\r\nOther examples\r\n\r\nIf you’re not a predominately online business or in the Civic space, should you still consider an API? They are mainly suited to information and knowledge based businesses. For example, I am currently ‘archiving’ a charity I used to run in Melbourne so that the information and resources we gathered can be utilized by others and aren’t wasted. As part of this process we will provide an API so others can aggregate and utilize our content. We will be charging to access certain items of content, but most will be freely available. Whilst the delivery is all online, it draws on our offline experiences.\r\n\r\nIncreasingly hardware businesses will utilize more APIs. There is still software powering the hardware, but creating hardware with API access will mean that your products will have more potential and a longer life.\r\nJustification\r\n\r\nYou may be a forward thinking individual inside of an organizational structure that doesn’t share your views. How can you convince others around you that having an API may be good for your business? Here are some positives to mention and some negatives to prepare yourself to hear.\r\nPositives\r\nConverting competitors into partners\r\n\r\nIf you are the first in your market with API access then you have the potential to bring your competitors on board by utilizing your data and resources in their products.\r\nUnexpected (positive) results\r\n\r\nGiving your users the ability to create some of their own specific tools has the potential of resulting in some unexpected new tools that you would never have had the inspiration or time to create yourself.\r\nScaling market reach\r\n\r\nBoth of the above points will help broaden your potential reach with little work and investment, perhaps only requiring better infrastructure.\r\nEmpowering users\r\n\r\nTrusting your users and giving them extra value beyond a core product helps encourage a strong feeling of loyalty. This increase of loyalty gives your company a small advantage over competition.', '', 'full_html'),
('node', 'blog_content', 0, 7, 7, 'und', 0, 'In part 1, we explained the different parts of eBay’s developer dashboard and configured our test application. We also created our database. Now we’re ready to create a project. In this part, we’ll focus on store settings. In part 3, we’ll add new products to our store.\r\nWe will be using the Slim framework for this app. Since Slim doesn’t really have the C in MVC baked into it, we also need to require the Slim controller. Then we also require Guzzle so that we can easily make API calls to eBay. Next is valitron for form validation. Lastly, there’s the upload library for validating and processing uploads.\r\nWe also specified the following options:\r\n\r\n    charset – the character set to be used by Twig.\r\n    cache – Twig compiles the templates that we’re using so it doesn’t have to do it on every page load. Those compiled template files are stored in the directory specified here.\r\n    auto_reload – this tells Twig to recompile the template every time the source code changes.\r\n    strict_variables – this tells Twig to return errors when a variable used in the template has not been declared.\r\n    autoescape – this tells Twig to automatically escape html, CSS and JavaScript code if encountered in the template.\r\n\r\nNext, we create a hook that would run before the Slim application is executed. What this hook does is attach the baseUrl to the view. This means that whatever value we assign to the baseUrl, it will always be accessible in every view. We use this value later on to link our front-end assets.', '', 'full_html'),
('node', 'blog_content', 0, 8, 8, 'und', 0, 'PHP has had many reputations over the years, but being insecure as a language never really was one of them.\r\n\r\nThe core team, all its faults notwithstanding, is rather quick in pouncing on all security matters, and updating PHP to the latest version will often allay all worries. But the end users, such as we are, tend to mess things up. We don’t update, we use outdated packages or packages with holes in them we’re not aware of, we use ancient extensions… we expose ourselves to risk in some truly creative ways.\r\n\r\nTips, Resources and Best Practices\r\n\r\nLet’s start 2015 off right, shall we? This post will list important resources you should have in your brain/toolbelt before building anything with PHP in 2015. I’ll do my best to keep this post up to date, so it stays relevant indefinitely, but, like I said, I’ll need your help.\r\nKeep your PHP up to date\r\n\r\nWhen I wrote about the cancer that is legacy code, I focused on application code. I still firmly believe that you should never develop for the lowest common denominator, else you risk becoming the very thing that’s holding your language’s progress back. That’s not the focus of this section, though. Recently, a new version related discussion ensued.\r\n\r\nCodeIgniter and WordPress are sticking with PHP 5.2 support (a version that’s been dead for four years now and shouldn’t exist on anyone’s server), and Anthony Ferrara responded in his blog post. Before you read this section any further, I implore you to read that post first. It’s important.\r\n\r\nWhat that post accomplished was getting some people too lazy to upgrade riled up.\r\n\r\nThey argued for legacy support without considering the damage they’re doing to the PHP ecosystem. Anthony wrote another post in which he further explains his stances, and finished up with yet another post taking apart installation percentages of old PHP versions across the web, comparing them to the stability list to find out how many servers running PHP out there are insecure by default and hackable – today. The results are frightening to say the least.\r\n\r\nIf you’re developing something and are running anything but the latest major version of PHP, I urge you to give these posts a thorough read. If your client insists on host X or version Y for whatever reason, refer them to these posts, educate them, and help them see the error of their ways – teach them about the vulnerabilities they’re introducing to their project, and tell them about the horrors that can happen if they don’t act before it’s too late. Upgrading your PHP’s version is not something you should file under “we can do that later”. Do it now, and do it often.', '', 'full_html'),
('node', 'blog_content', 0, 9, 9, 'und', 0, 'In my earlier articles, I have introduced the PHP-CPP lib to create an extension for PHP using C++ (first article and second article). In the latter, I demonstrated a bit of the OO side of writing a PHP extension with a Complex class doing complex number manipulations.\r\n\r\nThat introduction is not complete as the main focus of that article is more on the demonstration of the OO capability of PHP-CPP, not on the OO implementation details.\r\n\r\nIn this article, we will further drill down the Complex lib development, adding more member functions, and addressing some advanced topics in writing a PHP extension with OO features using PHP-CPP:\r\n\r\n    Returning this pointer;\r\n    Returning a Complex object pointer, i.e., a Complex *;\r\n    Exposing the __toString magic method;\r\n    Chaining member function calls;\r\n    Throwing an exception and handling it in PHP\r\n\r\nThe finished Complex lib source, as well as a test PHP script is located in this Github repo.', '', 'full_html'),
('node', 'blog_content', 0, 10, 10, 'und', 0, 'It’s good practice to always use a version control system in any of your projects. Be it a side-project in which you are the only developer, or a team project where five or more people are working on it together. But the idea of putting your database into version control isn’t really that widespread. Often times we take the database for granted.\r\n\r\nBut like the source files in our project, the database is constantly changing too. That’s why we also need a way to track the changes that we have made and easily share it to other members of our team.\r\n\r\nIn this article we will take a look at DBV, a database version control system written in PHP for MySQL databases so you need to have PHP and MySQL installed before you can use it, along with a web server like Apache or Nginx.\r\n\r\nAn important note about this software is that it is not a stand-alone database version control system, because it needs a version control system such as Git, Mercurial or SVN for syncing changes with your team.', '', 'full_html'),
('node', 'blog_content', 0, 11, 11, 'und', 0, 'Version control systems are invaluable for tracking changes in your code, particularly when you’re working in a team. However, most applications don’t consist solely of application code. Managing changes to the database has always been a little more challenging, particularly when you’re adding new features which require changes to the schema.\r\n\r\nSuppose you’re working on a module and realize one of the database tables needs an additional column. You might be tempted to open up a database query tool or the command line and simply add the column. However, this doesn’t leave a record of the change in the same way as version-controlled application code would. This gets exacerbated when working in a team – if a colleague pulls your code changes without running those same database updates, then it’s entirely possible their version of the application will break. This becomes even more problematic when you’re releasing a product update, when it could break the application not just for your fellow developers, but for your users.\r\n\r\nOne solution is to move responsibility for creating and modifying the database schema into code, using migrations. That way, changes can be managed along with the rest of your application, and features we take for granted in version control – such as being able to compare versions and keep an audit trail – can be used for database changes. It also allows these changes to be seamlessly incorporated into releases, since they can be made part of the same branch or tag.\r\n\r\nMany major frameworks have their own migration implementation, but for those that don’t – and if you’re not using any framework – there’s Ladder.', '', 'full_html'),
('node', 'blog_content', 0, 12, 12, 'und', 0, 'If you’re starting a website – be it a news site, a blog or an ecommerce site, chances are that you consider using WordPress. Once users begin to warm to the website as it gains popularity, core WordPress might not be enough to handle the incoming traffic efficiently. You will then need to scale up your website to handle the higher volume of incoming connections.\r\n\r\nThere are many ways of scaling your WordPress website, but we will focus on database tweaks in this post. WordPress uses MySQL as a database and this post assumes you are familiar to the database structure of WordPress.\r\n\r\nAs a precaution, you should never perform database queries on your server directly. Always keep proper backups before attempting to perform any actions mentioned here.\r\nClean Up\r\n\r\nFor the purpose of backup and security, WordPress stores a lot of data in the database that may not be directly visible in to the end user. For instance, WordPress saves every revision for your published posts, pages and drafts in the database. Comments which are yet to be published are also stored in the database. Unused tags, categories, dead links and media are stored in the database too.\r\n\r\nWhen your website is new, all this data may not cause a significant decrease in WordPress performance, but as the size of your website grows, this unnecessary data can increase the size of your database, which in turn, makes queries slower.\r\n\r\nYou could turn off revisions for your posts, which generally take up the greatest amount of space in your database compared to the other junk data, but I would suggest you periodically clean up your database as revisions may come in handy sometimes. Here’s a list of 10 steps to clean up your WordPress database, which includes deleting all unnecessary data.', '', 'full_html'),
('node', 'blog_content', 0, 13, 13, 'und', 0, 'here’s already a great article here that discusses Test Driven Development, but did you know that you can also test the code that interacts with your database? Especially if your application is data intensive, subjecting your CRUD code to a battery of tests is good practice that helps ensure that your application is working correctly.\r\n\r\nIn this article you will be learning how to write database tests in PHP using PHPUnit and its database extension. Accompanying code can be found on GitHub, so feel free to check the source and play with it.\r\n\r\nFor this exercise you’ll need PHPUnit and the PHPUnit Database extension. You can install both using PEAR. Just follow the instructions listed in the PHPUnit documentation.\r\n\r\nEditor Note Oct 20 2012: You can install both PHPUnit and the PHPUnit Database extension using Composer. The accompanying code on GitHub has been updated to use Composer for installing these dependencies.\r\nWarming Up\r\n\r\nIt’s time to get your feet wet! That means, just like in any software project, we’ll first examine what we are going to program.\r\n\r\nImagine you are the back-end ninja of an online webzine and you’ve just received the spec for a new magazine you’ll be building:\r\n\r\n    The magazine will be composed of many sections or webpages.\r\n    Each section shows at most four feature articles which are set by the editor of that section.\r\n\r\nFor this article, we’ll only test retrieving the articles when they are going to be displayed on the page. Hence we won’t be concerned with the use case where the editor chooses the articles. We’ll assume the feature articles have already been set and are in the database. This way we are isolating the behavior we want to test so we can focus solely on it (just like how you will actually do it in practice).\r\n\r\nOf course a necessary step here since we are writing a database test is to set up data. After all, we need something to test the CRUD operations on!', '', 'full_html'),
('node', 'blog_content', 0, 14, 14, 'und', 0, 'With everything hosted in the cloud nowadays, why wouldn’t you host your database in the cloud as well? In this article I will take a look at cloud providers offering MySQL cloud hosting. I will discuss their features, ease of use and price. This article will cover:\r\n\r\n    two providers offering just MySQL in the cloud: ClearDB and Xeround (Xeround is closing down as of May 15th, 2013. Read here).\r\n    two major cloud providers that offer hosted MySQL as part of their total offering: Amazon RDS for MySQL and Google Cloud SQL.\r\n\r\nFeatures\r\n\r\nEven though all providers offer a hosted MySQL database, there are some differences. You will find limitations with:\r\n\r\n    Xeround: Limitation in full MySQL compatibility, like ALTER table functions, log files and more. See release notes. These limitations are mostly in place to make dynamic scalability possible.\r\n    Google Cloud SQL: Limitation in full MySQL compatibility, and features like user defined functions and MySQL replication. See FAQ.\r\n\r\nAmazon RDS for MySQL and Google Cloud SQL are pretty straightforward cloud-based MySQL instances, without much juice to it but with the added benefit of being in the cloud (when it comes to scaling up or down, easy cloning etc.). They simply allow you to host your database in their cloud infrastructure, with the above limitations. Amazon RDS for MySQL also has the option to have a replication standby in case of failure of your main database, and offers automated backups.\r\n\r\nSelecting one of them depends mostly on which infrastructure you use to run your main applications. Amazon RDS would be the best fit if you host them on EC2 for example, because of low latencies. But the combo isn’t required, you can host a Google Cloud SQL database with an EC2 server.\r\n\r\nXeround en ClearDB take it up a notch, by providing high availability (100% uptime), easy backups and geo-distribution. Xeround tops it off with dynamic scalability for keeping up with size and throughput requirements. They both try to make it much easier for you to host your database in the cloud, without worrying about what happens when a node fails. They both run on Amazon AWS, as well as Rackspace Cloud and HP Cloud (Xeround) or Microsoft Azure (ClearDB).', '', 'full_html'),
('node', 'blog_content', 0, 15, 15, 'und', 0, 'When ASP.NET developers think of Web security and authentication, three options typically come to mind: Windows authentication, forms authentication, and passport authentication.\r\n\r\nIf you’re building an Intranet application within your organization, for instance, you might choose to use Windows authentication. Configuring Windows authentication within IIS is fairly straight forward and involves only two steps.\r\n\r\nFirst, we make sure that Integrated Windows Authentication is checked and Anonymous Access is unchecked for a Web application by following the steps outlined below:\r\n\r\n    Right-click on the Web app directory within IIS and select Properties.\r\n\r\n    Select the Directory Security tab from the application’s Properties dialog.\r\n\r\n    Select the Edit… button within the Anonymous Access and Authentication control panel.\r\n\r\n    Uncheck Anonymous Access and make sure that Integrated Windows Authentication is checked similar to the figure below.\r\n', '', 'full_html'),
('node', 'blog_content', 0, 16, 16, 'und', 0, 'A previous client of mine had an Access database of products they sell, which they had been using offline. But increasingly this working arrangement had proven to be limited. There had been too many instances when they needed to use the database but weren’t near the computer where they kept their database.\r\n\r\nWouldn’t it have been better for them to able to maintain their database where ever they were? Of course, but how? Simple – put it online. In addition, having their product database online opens the door to using it as the basis of a website for their business.\r\n\r\nThere’s another advantage to having an online database, but which is a significant – multi-user access. That is: storing the database on a server means that any authorized person be able to use the company’s product database using nothing more than a browser. And all as a result of moving an existing Access database file from an offline to an online location.\r\n\r\nTo make the transition to online databases easier, the existing Access database can be kept unchanged and simply uploaded to a suitable Windows host. (Linux hosting is possible too, but that’s slightly more complicated.) The hosting is not enough in itself, though, because you also need to build an interface allowing them to read and write to the database. Building an interface may sound daunting, but it needn’t be. In effect, what you’ll be doing is replacing the forms listed under the Forms tab in Access.\r\n\r\nIn this article I’ll focus on the essential elements of PHP you’ll need to use an existing Access database online. One other item that’s standard with a Windows installation is the availability of ODBC drivers. These are essential for the use of Access from PHP.', '', 'full_html'),
('node', 'blog_content', 0, 17, 17, 'und', 0, 'The number of users browsing the Web from a mobile device continues to rise, yet most mobile websites are still sub-par.\r\n\r\nThe thing is, creating a great web experience for users of mobile devices is much easier than you might think. In this article I’ll introduce seven fundamental steps that, if followed, will help you avoid the pitfalls that have caused many other mobile sites to fail. By the end of this article you’ll know exactly where to focus your efforts in order to build a successful mobile site.\r\n1. Don’t Mix Up Your Markup\r\n\r\nA few different types of markup are available for building a mobile website. You’ll need to choose one that suits the needs of your customers and stick with it.\r\n\r\nWML\r\n\r\nIn the early days of mobile web devices, the only way to surf the mobile web was to browse WAP (Wireless Application Protocol) sites. A WAP site uses WML (Wireless Markup Language) as its primary markup language. WML is an XML markup language based on the card-and-deck metaphor.\r\n\r\nLuckily for us, WML has since been superseded by several other technologies—in fact, if you’re just getting into the mobile web game, you can probably ignore WML entirely. WML is mostly used by legacy systems or by sites that explicitly target customers with low-end phones that are six years old or older.\r\n\r\nOne potential group of customers still using WML browsers, however, is those in developing nations. The Nokia 1100 and 1101, for example, are extremely basic, extremely cheap phones, of which an estimated 200 million units have been solid worldwide, making this phone the best-selling model to date, worldwide. If your site is targeted to this market segment, WML might be the best solution for you.', '', 'full_html'),
('node', 'blog_content', 0, 18, 18, 'und', 0, 'How many times has a client, manager, or colleague from a different department asked you to deliver something because it’s trendy?\r\n\r\nThey’ve seen it, they want it. Relevance, be damned.\r\n\r\nHow often has this trend been completely unsuitable for your website project? Saying “no” and explaining why a trend makes no sense for your website can be a challenge, so it’s helpful to understand what value a trend can add, and how to apply it effectively in your circumstances.\r\n\r\nParallax scrolling as a web design trend was born from the 2D video game world, originally as a hack for the platform to create a sense of depth in a scene. Noticing the rise in parallax scrolling over the last two years, a designer recently decided to apply the style to his newest web project: a landing page for a small line of retail products.\r\n\r\nWhile scrolling, lifestyle shots of the products should move slowly in the background while descriptions of the products should move quickly in the foreground, producing a parallax effect. In practice, however, the parallax scrolling would, by its nature, prevent the faster-moving descriptions from lining up with their slow-moving photos.\r\n\r\nThis highlights what can go wrong when applying a popular technique because it’s trendy instead of using it because it’s right for the job. So let’s look at when it can be helpful.', '', 'full_html'),
('node', 'blog_content', 0, 19, 19, 'und', 0, 'Video has always been one of the most powerful forms for visual communication. The worldwide influence of television and movies is testament to the inherent pull of the ‘moving image’.\r\n\r\nVideo backgrounds have become an interesting developing trend over the course of 2014. Traditionally video on the web has been about conveying messages. Video backgrounds often focus on setting an emotional tone or feeling than telling stories.\r\nTips for video backgrounds\r\n\r\nThe central idea that every web developer should keep in mind is that video backgrounds should not be used because they are trendy and pretty but, rather, because they can further the site message or to evoke a certain feeling.\r\nMute the audio\r\n\r\nUsually background video is set to “auto-play”, so it will automatically start as soon as a user opens the website. For this reason, it is generally good practice to mute the audio by default – giving the user the ability to unmute if necessary.\r\nLimit video lengths\r\n\r\nAnother aspect that you should consider is the length of the video, which, in most cases, restarts once finished. As with animated GIFs, short loops can create an irritating repetitive feel, while an overly long video sequences impact load times.\r\n\r\nCircumstances will vary case to case, but you probably should be shooting for between 15 and 25 seconds.\r\nDesign for a range of devices\r\n\r\nWhile there’s no doubt video backgrounds are a popular trend, this does not imply that every device supports them. Users who visit your site using a smartphone, a tablet or a legacy browser may not be able to render your video at all. A good web developer will always provide a static image as a fallback background.\r\n\r\nEven if a device technically can render your video, that doesn’t mean it automatically should. Forcing high resolution video on bandwidth-limited mobile devices can lead to a slow, potentially expensive user experience.\r\n\r\nAs with building for any device, it’s critical to think long and hard about the balance between quality and weight in order to maximize the results.', '', 'full_html'),
('node', 'blog_content', 0, 20, 20, 'und', 0, 'When the national library of France was built, it was an impressive feat of engineering and architecture. Like many buildings of the late 20th century, it used quite a bit of glass. In fact, as you can see, the majority of the facade is glass. Unfortunately, that made it into a huge hot greenhouse that started to damage the books. The thousands of giant wooden shutters that were put in to deflect the sunlight are a clumsy solution to a problem that could have been prevented.\r\nDancing House by Frank Gehry\r\n\r\nWho wants to clean those windows?\r\n\r\nDesign is something that everyone feels comfortable having an opinion about. No one is going to look at Gehry’s Dancing House and comment on how elegant the plumbing system is. Design is the emotional element that makes the biggest impression and can oftentimes be the factor that persuades a purchaser into making a bigger spend (both on the web and in construction). When used with purpose and planning, it not only makes things usable but also creates enjoyment and delight.\r\n\r\nIt can be very tempting to make a web project look impressive to passersby without giving due consideration to how people will be using it in their daily lives. Once a company “moves in” to a web site, the form will have to be adjusted to fit the function — just like the library’s big wooden shutters. The more planning that can be done beforehand, the less cost and time these adjustments will take.', '', 'full_html'),
('node', 'blog_content', 0, 21, 21, 'und', 0, 'a) The Casual Surfer\r\n\r\nThese customers act in a similar way to customers of traditional websites. Casual surfers are not really interested in any one thing, but have a few spare minutes between tasks to take a look around. In the world of desktop PCs, those few minutes might occur between meetings, or while the user’s on a short break. For a mobile customer, those few minutes might occur when the user’s sitting outside waiting to meet friends, in a car or taxi traveling somewhere, or even during the morning commute. If your site is focused on the sort of content that would appeal to casual surfers, then be aware of the limitations on the time and screen-size of your mobile customer.\r\n\r\nThe goal should be to make your content more “sticky”, so that casual surfers come back for more. For example, you shouldn’t serve up long pieces of content. Instead, aim for small, bite-sized chunks that are just enough to keep customers interested, but not so long that users can’t browse your site in the time they have available.\r\n\r\nb) The Repeat Visitor\r\n\r\nRepeat customers are those that are constantly returning for some sort of specific news or data. If your site is the kind of site that offers information about stocks, weather or sports scores, you probably have plenty of repeat visitors. The interface of a mobile device is very limited, so if you know what your repeat visitors are coming back for, time and time again, let that naturally bubble up to the top of the site. Avoid burying the content your customers want behind 3 or 4 clicks.\r\n\r\nMobile website customization can be difficult, but it’s not impossible. A traditional site might ask you to log in, but on a mobile device, data entry is not as easy to perform, so it’s best avoided.\r\n\r\nOne option is to allow visitors to use their desktop machines to streamline their mobile experience. Take a page from Apple’s iTunes Music Store as an example. A repeat customer might customize his or her version of the mobile site while at a desktop machine; this could generate a special URL in which all of that user’s preferences are encoded. The next time the user visits your site from a mobile device, he or she can take advantage of this special URL, enjoying an experience that’s completely customized to his or her preferences.\r\n\r\nc) The “Urgent, Now!” Visitor\r\n\r\nDepending on your business, your definition of “Urgent, Now!” will vary. For an online store, a customer might consider the following message urgent:\r\n\r\n“My books were supposed to arrive yesterday. They’re late. Where are they?”\r\n\r\nA more seriously urgent scenario might be:\r\n\r\n“I’m running 15 minutes late. Will I be able to catch my flight?”\r\n\r\nFor some customers, everything is urgent! But by identifying the most important needs of your customers and making the relevant information accessible within one click or less, you’ll increase the usefulness of your mobile site enormously.\r\n4. Publish the Bare Minimum\r\n\r\nOne of the common myths about mobile web development is the misguided notion that content from your traditional website can be easily re-purposed into smaller bit-sized chunks for the mobile version. A simple change of style from media="screen" to media="handheld" is all you need to do to magically mobilize your site, right?\r\n\r\nWrong.', '', 'full_html'),
('node', 'blog_content', 0, 22, 22, 'und', 0, 'As a graphic designer working in print, it is important to understand and work to a set of fixed standards. This ensures that what the designer produces will actually be usable as a print item and also printable! For example in print, designing a simple business card has its own factors to watch for – this is also dependant on who you use to print your jobs.\r\n\r\nSome common issues to watch for would be if the job is of a standard size (and if the printer offers its own set of guidelines and sizes), if you decide to print in laser (which affects price as well as color), or offset, if you are using solid or process, how much bleed should you leave and if they have affordable metallics – the list could go on and on! Even with so many varied print issues, we feel comfortable ensconsed in our guidelines and the familiar set of difficulties.\r\n\r\nSwitching to the web world, the issues of design are just as complex and varied. To a graphic designer who hasn’t ventured into web design, it can be a freaky place where suddenly our long used guidebook of print design goes out the window!\r\n\r\nOver the following weeks, I will cover basic as well as complex aspects of web design, but will not cross the threshold of coding. The aim is to arm the graphic designer with the knowledge and skills to design a solid website. There are many ways to design a website and this guide is one way.\r\n\r\nDesigning for the web gives you a freedom that you wouldn’t believe. However, there are certain factors that you need to keep in mind – depending on the job at hand of course! When putting pen to paper for your first design, or opening Photoshop or Illustrator, it is important to know what size the site is!\r\n\r\nAn important factor of website design is resolution as well as the physical size of the screen. It is important to know what sizes to design for as well as what affect the given sizes we choose for our client will have on the visitor’s screen.\r\n\r\nThe prevailing wisdom in web has been to design for the most common screen resolution that most people use and at the time of writing, it has been 1024 x 768 for quite a few years now. However, there is a relatively new and important factor that designers need to account for and that is the rise and prevelance of hand held devices. The popularity of the Android device as well as iOS (Apple’s operating system for most all things they manufacture – starting with the letter ‘i’) and the slow rise of Windows 7 devices, cannot be ignored and must be accounted for. These devices can be phone sized or tablet sized devices and their design size needs to be included in our new ‘guidebook’.', '', 'full_html'),
('node', 'blog_content', 0, 23, 23, 'und', 0, 'Jakob Nielsen, self-acclaimed Web usability expert, is loved by countless people and loathed by just as many. After a read of his book, Designing Web Usability (New Riders Publishing, 1999), many Web designers will seriously reconsider their approach to design, and many more will simply toss the tome into the fireplace.\r\n\r\nNielsen’s message is quite simple: a Website exists in order to help people accomplish a task, rather show off the designer’s skill. Regrettably, some of the steps he recommends to achieve that goal are drastic, and are not supported by solid evidence.\r\n\r\nAt many points throughout the book, Nielsen makes unfounded statements that are more opinion than fact. Even though he’s extremely well known, and is able to charge a six-figure fee for a usability critique, what he says shouldn”t be taken as the absolute truth. In fact, it should be quite the opposite. After all, any expert should have solid research to back up their statements, and, given the fact that his advice is so widely read, Neilsen in particular should be able to justify his claims.\r\n\r\nHowever, I will give credit to him for one thing – his book will make designers step out of their own shoes and into those of users, those people who will try to achieve a goal through the designers’ creations. The book has no lack of guidelines on writing, navigation, the use of space, scrolling, download time, search and cross-platform design, which push you to look at your own Website through the users’ eyes.\r\n\r\nHowever, the guidelines themselves seem to be stuck in a time warp. The author appears to believe that we live in 1997, where 28.8 modems and 14 inch monitors running at 640×480 are the norm. For many of today’s Websites, it’s unreasonable to restrict the design to such strict specifications. It seems that the only sites that could meet the ideals presented in this book would be graphics-free. Since his own Website only meets only 75% of his own principles, what hope is there for the rest of us?\r\n\r\nBack to the content of the book. The first four chapters, which focus on page design, content design and site design, are thought-provoking. The liberal use of visual examples is very useful, however in many cases they break up the continuity of the text. Sometimes, the caption that describes a screen shot appears on a different page than the screen capture itself, requiring you to flip back and forth. Other times, three of four pages are devoted to nothing but screen captures, which break up the content. In my mind, the book itself could have used a bit of usability engineering.\r\n\r\nI personally found Designing Web Usability rather wordy at 400 pages, especially in comparison to the concise and to-the-point-book on the very same subject titled Don’t Make Me Think. A more concise book, with a list of research references at the back would have been much better.\r\n\r\nThis leads me to another topic – Jakob Nielsen’s prophecies, also known as "Future Predictions", to which an entire chapter is devoted. After reading the whole chapter, I still couldn”t understand what it had to do with the subject at hand. I’m personally not as interested in the author’s future-forecasting abilities as I am in the subject of Web usability. No wonder Nielsen has been labeled by some as an egomaniac, preoccupied with tooting his own horn.\r\n\r\nAfter reading all of this, you’ll probably think I’m not about to recommend this book to everybody. You’re right. If you’ve never read a book on Web Usability, skip over Jakob Nielsen’s Designing Web Usability, and get Don’t Make Me Think. However, if, after reading that publication, you’re hungry for more, do read Jakob’s book – but with caution. His rules, if applied to the letter, would lead to a very dull site. There is a middle-ground somewhere, but it’s left for you to find, because the author certainly hasn’t presented it himself.', '', 'full_html'),
('node', 'blog_content', 0, 24, 24, 'und', 0, '5. Choose a Great Domain Name\r\n\r\nAs you build the mobile version of your site, you’ll need to decide upon the domain by which users will access it, and work out how to advertise the fact that it exists. There are several options for choosing a mobile domain. Let’s explore each of them.\r\n\r\n1. Use a separate domain altogether (e.g. www.example-mobile.com).\r\n\r\nCreating a separate domain has never been necessary for any of the sites I’ve worked on. A separate domain name can hurt your site’s overall branding and can confuse users—how many people will actually remember both the URL for your traditional website and your mobile version? And which site should you promote in your advertising? Such an approach can end up being a hassle, and is therefore not recommended.\r\n\r\n2. Use a subdomain (e.g. m.example.com).\r\n\r\nCreating a subdomain is probably the most popular option. Using a subdomain (such as mobile, or just m to keep it short) keeps your mobile site part of your brand without creating confusion. Obviously, if it suits your customers, you might want to localize the term ‘mobile’. And if adding ‘m’ to the start of your domain name spells something horrible, you might consider placing the mobile element at the end of your URL (e.g. http://example.com/mobile/).\r\n\r\nEither way, you should assume that people will get the address of your mobile site wrong. Anticipate this eventuality by setting up several different common subdomains—m, mobile and others—and redirecting them all to a single mobile site, just as you should redirect typos like ww and wwww for your traditional website to www.', '', 'full_html');
