(1, 'node', ' services lorem ipsum is simply dummy text of the printing and typesetting industry lorem ipsum has been the industry s standard dummy text ever since the 1500s when an unknown printer took a galley of type and scrambled it to make a type specimen book it has survived not only five centuries but also the leap into electronic typesetting remaining essentially unchanged it was popularised in the 1960s with the release of letraset sheets containing lorem ipsum passages and more recently with desktop publishing software like aldus pagemaker including versions of lorem ipsum  ', 0),
(2, 'node', ' about us lorem ipsum is simply dummy text of the printing and typesetting industry lorem ipsum has been the industry s standard dummy text ever since the 1500s when an unknown printer took a galley of type and scrambled it to make a type specimen book it has survived not only five centuries but also the leap into electronic typesetting remaining essentially unchanged it was popularised in the 1960s with the release of letraset sheets containing lorem ipsum passages and more recently with desktop publishing software like aldus pagemaker including versions of lorem ipsum  ', 0),
(3, 'node', ' learn ', 0),
(4, 'node', ' the php 7 revolution return types and removed artifacts with the planned date for php 7 s release rapidly approaching the internals group is hard at work trying to fix our beloved language as much as possible by both removing artifacts and adding some long desired features there are many rfcs we could study and discuss but in this post i d like to focus on three that grabbed my attention php 57 vs php 7 as i mentioned in the last newsletter 57 has been downvoted in favor of moving directly to php 7 this means there will be no new version between 56 and 7 even if the new version was only to serve as a warning light to those still stuck on outdated code originally 57 was not supposed to have new features but was supposed to throw out notices and warnings of deprecation about code that s about to change in v7 it would also warn about some keywords that are to be reserved in php 7 so that people can bring their code up to speed with a sort of automatic compatibility checker in the form of an entire php version the thing is however as i argue in the newsletter that most people technologically competent enough to follow php in its upgrade path by keeping up with the most recent version aren t generally the type of people to actually be using code that might break in php 7 while this is a good discussion to have what s done is done and the voting is over what do you think about this  php ', 0),
(5, 'node', ' modernizing legacy applications in php review chances are you ve come across some horrible legacy code once or twice in your lifetime as a php developer heck if you ve worked with wordpress to any degree i m sure you have i myself have had the satisfying task of modernizing a monolithic zf1 application and it was the most mentally exhaustive but admittedly the most educational year of my career if only i had had paul m jones modernizing legacy applications in php book back then i would have been done in half the time and the work i did would have been twice as good the book many thanks to paul for providing me with a review copy after having read my review of design patterns in php the book is a leanpub publication meaning it s selfpublished but that s where similarities with other leanpub content i ve consumed so far end modernizing legacy applications in php is a detailed step by step guide in turning a spaghetti mess of old php code you ve probably inherited from a team that left two generations ago into a sort of fully fledged mvc application with the front controller router dependency injection and even unit tests rather than regurgitating common examples found online and various wikipedia definitions in shortened form the book takes a hands on approach with sample code eerily similar to things i ve seen over and over again in legacy projects this not only verifies a senior developer s suspicions about the similar state of decrepitude in most legacy apps but also inspires one to delve deeper as it seems most of us share the same problems at some time and thus can use the same solutions approachability this book is not for beginners i mean if you re a beginner i recommend getting it right away and just keeping it in your leanpub dashboard for when you ll be able to implicitly recognize the terms discussed within but if you don t have a horrible largescale legacy project or two under your belt before you start reading it you won t understand much and ploughing through the content on autopilot without knowing what it does is counterproductive at best besides you ll probably do it wrong because every legacy app is different despite most of them being similar this book is aimed at intermediate and higher level php users with an emphasis on seniors intermediate devs won t get 100 out of it they ll understand more of the content and they ll be able to use some of it as a prevention against future horrors while working on their apps right now which again is reason enough to recommend a purchase but intermediate devs are generally still getting familiar with best practices and haven t been out of the procedural marshes for very long the mud and sludge still dripping from their i finally know php shirts php ', 0),
(6, 'node', ' do you need an api  api stands for application programming interface and as the name implies creating one is a technical process this article will talk very little about how to create an api as there are a myriad of methods to undertake that this article aims to focus on the business side of apis and supply advice for nontechnical folk an api is a set of functionality and instructions to allow other software access to services or information you offer an api is typically should be written following standard patterns and can be free or monetized in several ways who has them lets start with some examples to better illustrate what an api is and how they are used most online services of any worth these examples are obvious ones but worth starting with to clarify the concept apis are part of the core business of companies such as google salesforce yelp and twitter all of these companies provide access to the information they posses through apis that are widely used by other businesses and their developers in a variety of applications all of these companies offer varying payment levels depending on the quality or quantity of access you require from free upwards government civic and science organizations these are not conventional businesses but this sector has seen such a recent growth in api adoption it seemed worthy of mention governments across the world from local to federal have started releasing certain data sets to the public through apis there is mixed opinion on how effective and useful some of these data sets have been but it is a brave first step and some have resulted in incredible insights and applications other examples if you re not a predominately online business or in the civic space should you still consider an api they are mainly suited to information and knowledge based businesses for example i am currently archiving a charity i used to run in melbourne so that the information and resources we gathered can be utilized by others and aren t wasted as part of this process we will provide an api so others can aggregate and utilize our content we will be charging to access certain items of content but most will be freely available whilst the delivery is all online it draws on our offline experiences increasingly hardware businesses will utilize more apis there is still software powering the hardware but creating hardware with api access will mean that your products will have more potential and a longer life justification you may be a forward thinking individual inside of an organizational structure that doesn t share your views how can you convince others around you that having an api may be good for your business here are some positives to mention and some negatives to prepare yourself to hear positives converting competitors into partners if you are the first in your market with api access then you have the potential to bring your competitors on board by utilizing your data and resources in their products unexpected positive results giving your users the ability to create some of their own specific tools has the potential of resulting in some unexpected new tools that you would never have had the inspiration or time to create yourself scaling market reach both of the above points will help broaden your potential reach with little work and investment perhaps only requiring better infrastructure empowering users trusting your users and giving them extra value beyond a core product helps encourage a strong feeling of loyalty this increase of loyalty gives your company a small advantage over competition php ', 0),
(7, 'node', ' configuring your store s settings with the ebay trading api in part 1 we explained the different parts of ebay s developer dashboard and configured our test application we also created our database now we re ready to create a project in this part we ll focus on store settings in part 3 we ll add new products to our store we will be using the slim framework for this app since slim doesn t really have the c in mvc baked into it we also need to require the slim controller then we also require guzzle so that we can easily make api calls to ebay next is valitron for form validation lastly there s the upload library for validating and processing uploads we also specified the following options charset the character set to be used by twig cache twig compiles the templates that we re using so it doesn t have to do it on every page load those compiled template files are stored in the directory specified here autoreload this tells twig to recompile the template every time the source code changes strictvariables this tells twig to return errors when a variable used in the template has not been declared autoescape this tells twig to automatically escape html css and javascript code if encountered in the template next we create a hook that would run before the slim application is executed what this hook does is attach the baseurl to the view this means that whatever value we assign to the baseurl it will always be accessible in every view we use this value later on to link our frontend assets php ', 0),
(8, 'node', ' php tips resources and best practices for 2015 php has had many reputations over the years but being insecure as a language never really was one of them the core team all its faults notwithstanding is rather quick in pouncing on all security matters and updating php to the latest version will often allay all worries but the end users such as we are tend to mess things up we don t update we use outdated packages or packages with holes in them we re not aware of we use ancient extensions we expose ourselves to risk in some truly creative ways tips resources and best practices let s start 2015 off right shall we this post will list important resources you should have in your brain toolbelt before building anything with php in 2015 i ll do my best to keep this post up to date so it stays relevant indefinitely but like i said i ll need your help keep your php up to date when i wrote about the cancer that is legacy code i focused on application code i still firmly believe that you should never develop for the lowest common denominator else you risk becoming the very thing that s holding your language s progress back that s not the focus of this section though recently a new version related discussion ensued codeigniter and wordpress are sticking with php 52 support a version that s been dead for four years now and shouldn t exist on anyone s server and anthony ferrara responded in his blog post before you read this section any further i implore you to read that post first it s important what that post accomplished was getting some people too lazy to upgrade riled up they argued for legacy support without considering the damage they re doing to the php ecosystem anthony wrote another post in which he further explains his stances and finished up with yet another post taking apart installation percentages of old php versions across the web comparing them to the stability list to find out how many servers running php out there are insecure by default and hackable today the results are frightening to say the least if you re developing something and are running anything but the latest major version of php i urge you to give these posts a thorough read if your client insists on host x or version y for whatever reason refer them to these posts educate them and help them see the error of their ways teach them about the vulnerabilities they re introducing to their project and tell them about the horrors that can happen if they don t act before it s too late upgrading your php s version is not something you should file under we can do that later do it now and do it often php ', 0),
(9, 'node', ' developing php extensions with c and phpcpp advanced in my earlier articles i have introduced the phpcpp lib to create an extension for php using c first article and second article in the latter i demonstrated a bit of the oo side of writing a php extension with a complex class doing complex number manipulations that introduction is not complete as the main focus of that article is more on the demonstration of the oo capability of phpcpp not on the oo implementation details in this article we will further drill down the complex lib development adding more member functions and addressing some advanced topics in writing a php extension with oo features using phpcpp returning this pointer returning a complex object pointer ie a complex exposing the tostring magic method chaining member function calls throwing an exception and handling it in php the finished complex lib source as well as a test php script is located in this github repo php ', 0),
(10, 'node', ' database versioning with dbv it s good practice to always use a version control system in any of your projects be it a sideproject in which you are the only developer or a team project where five or more people are working on it together but the idea of putting your database into version control isn t really that widespread often times we take the database for granted but like the source files in our project the database is constantly changing too that s why we also need a way to track the changes that we have made and easily share it to other members of our team in this article we will take a look at dbv a database version control system written in php for mysql databases so you need to have php and mysql installed before you can use it along with a web server like apache or nginx an important note about this software is that it is not a standalone database version control system because it needs a version control system such as git mercurial or svn for syncing changes with your team database ', 0),
(11, 'node', ' database versioning with ladder migrations version control systems are invaluable for tracking changes in your code particularly when you re working in a team however most applications don t consist solely of application code managing changes to the database has always been a little more challenging particularly when you re adding new features which require changes to the schema suppose you re working on a module and realize one of the database tables needs an additional column you might be tempted to open up a database query tool or the command line and simply add the column however this doesn t leave a record of the change in the same way as versioncontrolled application code would this gets exacerbated when working in a team if a colleague pulls your code changes without running those same database updates then it s entirely possible their version of the application will break this becomes even more problematic when you re releasing a product update when it could break the application not just for your fellow developers but for your users one solution is to move responsibility for creating and modifying the database schema into code using migrations that way changes can be managed along with the rest of your application and features we take for granted in version control such as being able to compare versions and keep an audit trail can be used for database changes it also allows these changes to be seamlessly incorporated into releases since they can be made part of the same branch or tag many major frameworks have their own migration implementation but for those that don t and if you re not using any framework there s ladder database ', 0),
(12, 'node', ' database changes to improve wordpress performance if you re starting a website be it a news site a blog or an ecommerce site chances are that you consider using wordpress once users begin to warm to the website as it gains popularity core wordpress might not be enough to handle the incoming traffic efficiently you will then need to scale up your website to handle the higher volume of incoming connections there are many ways of scaling your wordpress website but we will focus on database tweaks in this post wordpress uses mysql as a database and this post assumes you are familiar to the database structure of wordpress as a precaution you should never perform database queries on your server directly always keep proper backups before attempting to perform any actions mentioned here clean up for the purpose of backup and security wordpress stores a lot of data in the database that may not be directly visible in to the end user for instance wordpress saves every revision for your published posts pages and drafts in the database comments which are yet to be published are also stored in the database unused tags categories dead links and media are stored in the database too when your website is new all this data may not cause a significant decrease in wordpress performance but as the size of your website grows this unnecessary data can increase the size of your database which in turn makes queries slower you could turn off revisions for your posts which generally take up the greatest amount of space in your database compared to the other junk data but i would suggest you periodically clean up your database as revisions may come in handy sometimes here s a list of 10 steps to clean up your wordpress database which includes deleting all unnecessary data database ', 0),
(13, 'node', ' bulletproofing database interactions with phpunit database extension here s already a great article here that discusses test driven development but did you know that you can also test the code that interacts with your database especially if your application is data intensive subjecting your crud code to a battery of tests is good practice that helps ensure that your application is working correctly in this article you will be learning how to write database tests in php using phpunit and its database extension accompanying code can be found on github so feel free to check the source and play with it for this exercise you ll need phpunit and the phpunit database extension you can install both using pear just follow the instructions listed in the phpunit documentation editor note oct 20 2012 you can install both phpunit and the phpunit database extension using composer the accompanying code on github has been updated to use composer for installing these dependencies warming up it s time to get your feet wet that means just like in any software project we ll first examine what we are going to program imagine you are the backend ninja of an online webzine and you ve just received the spec for a new magazine you ll be building the magazine will be composed of many sections or webpages each section shows at most four feature articles which are set by the editor of that section for this article we ll only test retrieving the articles when they are going to be displayed on the page hence we won t be concerned with the use case where the editor chooses the articles we ll assume the feature articles have already been set and are in the database this way we are isolating the behavior we want to test so we can focus solely on it just like how you will actually do it in practice of course a necessary step here since we are writing a database test is to set up data after all we need something to test the crud operations on  database ', 0),
(14, 'node', ' database as a service mysql in the cloud with everything hosted in the cloud nowadays why wouldn t you host your database in the cloud as well in this article i will take a look at cloud providers offering mysql cloud hosting i will discuss their features ease of use and price this article will cover two providers offering just mysql in the cloud cleardb and xeround xeround is closing down as of may 15th 2013 read here two major cloud providers that offer hosted mysql as part of their total offering amazon rds for mysql and google cloud sql features even though all providers offer a hosted mysql database there are some differences you will find limitations with xeround limitation in full mysql compatibility like alter table functions log files and more see release notes these limitations are mostly in place to make dynamic scalability possible google cloud sql limitation in full mysql compatibility and features like user defined functions and mysql replication see faq amazon rds for mysql and google cloud sql are pretty straightforward cloudbased mysql instances without much juice to it but with the added benefit of being in the cloud when it comes to scaling up or down easy cloning etc they simply allow you to host your database in their cloud infrastructure with the above limitations amazon rds for mysql also has the option to have a replication standby in case of failure of your main database and offers automated backups selecting one of them depends mostly on which infrastructure you use to run your main applications amazon rds would be the best fit if you host them on ec2 for example because of low latencies but the combo isn t required you can host a google cloud sql database with an ec2 server xeround en cleardb take it up a notch by providing high availability 100 uptime easy backups and geodistribution xeround tops it off with dynamic scalability for keeping up with size and throughput requirements they both try to make it much easier for you to host your database in the cloud without worrying about what happens when a node fails they both run on amazon aws as well as rackspace cloud and hp cloud xeround or microsoft azure cleardb  database ', 0),
(15, 'node', ' securing passwords in your database when aspnet developers think of web security and authentication three options typically come to mind windows authentication forms authentication and passport authentication if you re building an intranet application within your organization for instance you might choose to use windows authentication configuring windows authentication within iis is fairly straight forward and involves only two steps first we make sure that integrated windows authentication is checked and anonymous access is unchecked for a web application by following the steps outlined below rightclick on the web app directory within iis and select properties select the directory security tab from the application s properties dialog select the edit button within the anonymous access and authentication control panel uncheck anonymous access and make sure that integrated windows authentication is checked similar to the figure below database ', 0),
(16, 'node', ' using an access database with php a previous client of mine had an access database of products they sell which they had been using offline but increasingly this working arrangement had proven to be limited there had been too many instances when they needed to use the database but weren t near the computer where they kept their database wouldn t it have been better for them to able to maintain their database where ever they were of course but how simple put it online in addition having their product database online opens the door to using it as the basis of a website for their business there s another advantage to having an online database but which is a significant multiuser access that is storing the database on a server means that any authorized person be able to use the company s product database using nothing more than a browser and all as a result of moving an existing access database file from an offline to an online location to make the transition to online databases easier the existing access database can be kept unchanged and simply uploaded to a suitable windows host linux hosting is possible too but that s slightly more complicated the hosting is not enough in itself though because you also need to build an interface allowing them to read and write to the database building an interface may sound daunting but it needn t be in effect what you ll be doing is replacing the forms listed under the forms tab in access in this article i ll focus on the essential elements of php you ll need to use an existing access database online one other item that s standard with a windows installation is the availability of odbc drivers these are essential for the use of access from php database ', 0),
(17, 'node', ' designing for the mobile web article the number of users browsing the web from a mobile device continues to rise yet most mobile websites are still subpar the thing is creating a great web experience for users of mobile devices is much easier than you might think in this article i ll introduce seven fundamental steps that if followed will help you avoid the pitfalls that have caused many other mobile sites to fail by the end of this article you ll know exactly where to focus your efforts in order to build a successful mobile site 1 don t mix up your markup a few different types of markup are available for building a mobile website you ll need to choose one that suits the needs of your customers and stick with it wml in the early days of mobile web devices the only way to surf the mobile web was to browse wap wireless application protocol sites a wap site uses wml wireless markup language as its primary markup language wml is an xml markup language based on the cardanddeck metaphor luckily for us wml has since been superseded by several other technologies in fact if you re just getting into the mobile web game you can probably ignore wml entirely wml is mostly used by legacy systems or by sites that explicitly target customers with lowend phones that are six years old or older one potential group of customers still using wml browsers however is those in developing nations the nokia 1100 and 1101 for example are extremely basic extremely cheap phones of which an estimated 200 million units have been solid worldwide making this phone the bestselling model to date worldwide if your site is targeted to this market segment wml might be the best solution for you web designing ', 0),
(18, 'node', ' the perils and perks of designing with parallax how many times has a client manager or colleague from a different department asked you to deliver something because it s trendy they ve seen it they want it relevance be damned how often has this trend been completely unsuitable for your website project saying no and explaining why a trend makes no sense for your website can be a challenge so it s helpful to understand what value a trend can add and how to apply it effectively in your circumstances parallax scrolling as a web design trend was born from the 2d video game world originally as a hack for the platform to create a sense of depth in a scene noticing the rise in parallax scrolling over the last two years a designer recently decided to apply the style to his newest web project a landing page for a small line of retail products while scrolling lifestyle shots of the products should move slowly in the background while descriptions of the products should move quickly in the foreground producing a parallax effect in practice however the parallax scrolling would by its nature prevent the fastermoving descriptions from lining up with their slowmoving photos this highlights what can go wrong when applying a popular technique because it s trendy instead of using it because it s right for the job so let s look at when it can be helpful web designing ', 0),
(19, 'node', ' tips for designing with video backgrounds video has always been one of the most powerful forms for visual communication the worldwide influence of television and movies is testament to the inherent pull of the moving image video backgrounds have become an interesting developing trend over the course of 2014 traditionally video on the web has been about conveying messages video backgrounds often focus on setting an emotional tone or feeling than telling stories tips for video backgrounds the central idea that every web developer should keep in mind is that video backgrounds should not be used because they are trendy and pretty but rather because they can further the site message or to evoke a certain feeling mute the audio usually background video is set to autoplay so it will automatically start as soon as a user opens the website for this reason it is generally good practice to mute the audio by default giving the user the ability to unmute if necessary limit video lengths another aspect that you should consider is the length of the video which in most cases restarts once finished as with animated gifs short loops can create an irritating repetitive feel while an overly long video sequences impact load times circumstances will vary case to case but you probably should be shooting for between 15 and 25 seconds design for a range of devices while there s no doubt video backgrounds are a popular trend this does not imply that every device supports them users who visit your site using a smartphone a tablet or a legacy browser may not be able to render your video at all a good web developer will always provide a static image as a fallback background even if a device technically can render your video that doesn t mean it automatically should forcing high resolution video on bandwidthlimited mobile devices can lead to a slow potentially expensive user experience as with building for any device it s critical to think long and hard about the balance between quality and weight in order to maximize the results web designing ', 0),
(20, 'node', ' overdesigning the web when the national library of france was built it was an impressive feat of engineering and architecture like many buildings of the late 20th century it used quite a bit of glass in fact as you can see the majority of the facade is glass unfortunately that made it into a huge hot greenhouse that started to damage the books the thousands of giant wooden shutters that were put in to deflect the sunlight are a clumsy solution to a problem that could have been prevented dancing house by frank gehry who wants to clean those windows design is something that everyone feels comfortable having an opinion about no one is going to look at gehry s dancing house and comment on how elegant the plumbing system is design is the emotional element that makes the biggest impression and can oftentimes be the factor that persuades a purchaser into making a bigger spend both on the web and in construction when used with purpose and planning it not only makes things usable but also creates enjoyment and delight it can be very tempting to make a web project look impressive to passersby without giving due consideration to how people will be using it in their daily lives once a company moves in to a web site the form will have to be adjusted to fit the function just like the library s big wooden shutters the more planning that can be done beforehand the less cost and time these adjustments will take web designing ', 0),
(21, 'node', ' designing for the mobile web article a the casual surfer these customers act in a similar way to customers of traditional websites casual surfers are not really interested in any one thing but have a few spare minutes between tasks to take a look around in the world of desktop pcs those few minutes might occur between meetings or while the user s on a short break for a mobile customer those few minutes might occur when the user s sitting outside waiting to meet friends in a car or taxi traveling somewhere or even during the morning commute if your site is focused on the sort of content that would appeal to casual surfers then be aware of the limitations on the time and screensize of your mobile customer the goal should be to make your content more sticky so that casual surfers come back for more for example you shouldn t serve up long pieces of content instead aim for small bitesized chunks that are just enough to keep customers interested but not so long that users can t browse your site in the time they have available b the repeat visitor repeat customers are those that are constantly returning for some sort of specific news or data if your site is the kind of site that offers information about stocks weather or sports scores you probably have plenty of repeat visitors the interface of a mobile device is very limited so if you know what your repeat visitors are coming back for time and time again let that naturally bubble up to the top of the site avoid burying the content your customers want behind 3 or 4 clicks mobile website customization can be difficult but it s not impossible a traditional site might ask you to log in but on a mobile device data entry is not as easy to perform so it s best avoided one option is to allow visitors to use their desktop machines to streamline their mobile experience take a page from apple s itunes music store as an example a repeat customer might customize his or her version of the mobile site while at a desktop machine this could generate a special url in which all of that user s preferences are encoded the next time the user visits your site from a mobile device he or she can take advantage of this special url enjoying an experience that s completely customized to his or her preferences c the urgent now visitor depending on your business your definition of urgent now will vary for an online store a customer might consider the following message urgent my books were supposed to arrive yesterday they re late where are they a more seriously urgent scenario might be i m running 15 minutes late will i be able to catch my flight for some customers everything is urgent but by identifying the most important needs of your customers and making the relevant information accessible within one click or less you ll increase the usefulness of your mobile site enormously 4 publish the bare minimum one of the common myths about mobile web development is the misguided notion that content from your traditional website can be easily repurposed into smaller bitsized chunks for the mobile version a simple change of style from media screen to media handheld is all you need to do to magically mobilize your site right wrong web designing ', 0),
(22, 'node', ' designing for the web resolution and size as a graphic designer working in print it is important to understand and work to a set of fixed standards this ensures that what the designer produces will actually be usable as a print item and also printable for example in print designing a simple business card has its own factors to watch for this is also dependant on who you use to print your jobs some common issues to watch for would be if the job is of a standard size and if the printer offers its own set of guidelines and sizes if you decide to print in laser which affects price as well as color or offset if you are using solid or process how much bleed should you leave and if they have affordable metallics the list could go on and on even with so many varied print issues we feel comfortable ensconsed in our guidelines and the familiar set of difficulties switching to the web world the issues of design are just as complex and varied to a graphic designer who hasn t ventured into web design it can be a freaky place where suddenly our long used guidebook of print design goes out the window over the following weeks i will cover basic as well as complex aspects of web design but will not cross the threshold of coding the aim is to arm the graphic designer with the knowledge and skills to design a solid website there are many ways to design a website and this guide is one way designing for the web gives you a freedom that you wouldn t believe however there are certain factors that you need to keep in mind depending on the job at hand of course when putting pen to paper for your first design or opening photoshop or illustrator it is important to know what size the site is an important factor of website design is resolution as well as the physical size of the screen it is important to know what sizes to design for as well as what affect the given sizes we choose for our client will have on the visitor s screen the prevailing wisdom in web has been to design for the most common screen resolution that most people use and at the time of writing it has been 1024 x 768 for quite a few years now however there is a relatively new and important factor that designers need to account for and that is the rise and prevelance of hand held devices the popularity of the android device as well as ios apple s operating system for most all things they manufacture starting with the letter i and the slow rise of windows 7 devices cannot be ignored and must be accounted for these devices can be phone sized or tablet sized devices and their design size needs to be included in our new guidebook  web designing ', 0),
(23, 'node', ' review designing web usability jakob nielsen selfacclaimed web usability expert is loved by countless people and loathed by just as many after a read of his book designing web usability new riders publishing 1999 many web designers will seriously reconsider their approach to design and many more will simply toss the tome into the fireplace nielsen s message is quite simple a website exists in order to help people accomplish a task rather show off the designer s skill regrettably some of the steps he recommends to achieve that goal are drastic and are not supported by solid evidence at many points throughout the book nielsen makes unfounded statements that are more opinion than fact even though he s extremely well known and is able to charge a sixfigure fee for a usability critique what he says shouldn t be taken as the absolute truth in fact it should be quite the opposite after all any expert should have solid research to back up their statements and given the fact that his advice is so widely read neilsen in particular should be able to justify his claims however i will give credit to him for one thing his book will make designers step out of their own shoes and into those of users those people who will try to achieve a goal through the designers creations the book has no lack of guidelines on writing navigation the use of space scrolling download time search and crossplatform design which push you to look at your own website through the users eyes however the guidelines themselves seem to be stuck in a time warp the author appears to believe that we live in 1997 where 288 modems and 14 inch monitors running at 640 480 are the norm for many of today s websites it s unreasonable to restrict the design to such strict specifications it seems that the only sites that could meet the ideals presented in this book would be graphicsfree since his own website only meets only 75 of his own principles what hope is there for the rest of us back to the content of the book the first four chapters which focus on page design content design and site design are thoughtprovoking the liberal use of visual examples is very useful however in many cases they break up the continuity of the text sometimes the caption that describes a screen shot appears on a different page than the screen capture itself requiring you to flip back and forth other times three of four pages are devoted to nothing but screen captures which break up the content in my mind the book itself could have used a bit of usability engineering i personally found designing web usability rather wordy at 400 pages especially in comparison to the concise and tothepointbook on the very same subject titled don t make me think a more concise book with a list of research references at the back would have been much better this leads me to another topic jakob nielsen s prophecies also known as future predictions to which an entire chapter is devoted after reading the whole chapter i still couldn t understand what it had to do with the subject at hand i m personally not as interested in the author s futureforecasting abilities as i am in the subject of web usability no wonder nielsen has been labeled by some as an egomaniac preoccupied with tooting his own horn after reading all of this you ll probably think i m not about to recommend this book to everybody you re right if you ve never read a book on web usability skip over jakob nielsen s designing web usability and get don t make me think however if after reading that publication you re hungry for more do read jakob s book but with caution his rules if applied to the letter would lead to a very dull site there is a middleground somewhere but it s left for you to find because the author certainly hasn t presented it himself web designing ', 0),
(24, 'node', ' designing for the mobile web article 5 choose a great domain name as you build the mobile version of your site you ll need to decide upon the domain by which users will access it and work out how to advertise the fact that it exists there are several options for choosing a mobile domain let s explore each of them 1 use a separate domain altogether eg wwwexamplemobilecom  creating a separate domain has never been necessary for any of the sites i ve worked on a separate domain name can hurt your site s overall branding and can confuse users how many people will actually remember both the url for your traditional website and your mobile version and which site should you promote in your advertising such an approach can end up being a hassle and is therefore not recommended 2 use a subdomain eg mexamplecom creating a subdomain is probably the most popular option using a subdomain such as mobile or just m to keep it short keeps your mobile site part of your brand without creating confusion obviously if it suits your customers you might want to localize the term mobile and if adding m to the start of your domain name spells something horrible you might consider placing the mobile element at the end of your url eg http examplecom mobile   either way you should assume that people will get the address of your mobile site wrong anticipate this eventuality by setting up several different common subdomains m mobile and others and redirecting them all to a single mobile site just as you should redirect typos like ww and wwww for your traditional website to www web designing ', 0);
